import React from "react";

function Numbers(){
    return(
        <div className="numbers">
            <div class="container">1</div>
        <div class="container-numbers">2</div>
        <div class="container-numbers">3</div>
        <div class="container-numbers">4</div>
        <div class="container-numbers">5</div>
        <div class="container-numbers">6</div>
        <div class="container-numbers">7</div>
        <div class="container-numbers">8</div>
        <div class="container-numbers">9</div>
        <div class="container-numbers">0</div>
        </div>
        
    )
}

export default Numbers;
